import React  from "react";
//import ToDoList from "./todoitems";
const AddItem =(props)=>{
 const {items} = props;
  const {addItem} = props;
return (
    <div className="AddItem">
  <input type="text" id="itemName">ItemName</input>
 <input type="submit" id="itemAge">ItemAge</input>   
         <button onClick={addItem(items)} type="submit">Add</button>
         </div>
)
}
export default AddItem;
